[asy]
unitsize(0.5 cm);

pair A, B, C, D, O;

A = (7,9);
C = (10,2);
O = (A + C)/2;
B = rotate(90,O)*(A);
D = rotate(90,O)*(C);

draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);

dot("$(7,9)$", A, N);
dot("$(10,2)$", C, S);
dot(O);
[/asy]

